{'edges': [{'node': {'text': 'Cowboy Josh hopped on a motorcycle with a Mongolian kid and experienced what could only be described as pure, unadulterated joy.

Out there, in the middle of nowhere, you realize how much horses are not just a symbol for freedom but a feeling itself. Fast, wild, and untethered.

This is what Mongolia gives you: room to remember who you really are.'}}]}

{'edges': [{'node': {'text': 'Part 2 of 2: Under the Wild Free-Roaming Horses and Burros Act of 1971 (WFRHBA).

This law defines horses as ‚Äúliving symbols of the historic and pioneer spirit of the West‚Äù and mandates their protection on public lands managed by the Bureau of Land Management (BLM) and the U.S. Forest Service. 

Horses originated in North America millions of years ago (like Equus ferus), but went extinct on this continent around 10,000 years ago, likely due to climate change and human activity and today Wild horses in North America are not truly ‚Äúwild‚Äù in the ecological sense‚Äî descended from domestic horses reintroduced by Europeans in the 1500s. Interesting perspective all around.'}}]}

{'edges': [{'node': {'text': 'pt. 3: Governor Sam & 25 Racehorses

What happens when you mix generations of horse lovers, baseball, and political ambition?

You get Governor Sam. A horse named in jest by Sam Bregman‚Äôs son. The Bregmans now own over two dozen racehorses, carrying forward a legacy of horse racing, family, and fun.'}}]}

{'edges': [{'node': {'text': 'Pt. 2: Betting on the Ponies

‚ÄúYou‚Äôre gonna learn more with me at the racetrack than in that schoolhouse today.‚Äù

Sam takes us back to his East Coast roots‚Äîwhere his grandfather used to pick him up behind school and sneak him off to Pimlico. The racing bug bit early, and it never let go.'}}]}

