{'edges': [{'node': {'text': 'Aversion towards the driving aids can have many reasons from a natural aversion towards physical pressure, training holes, prior reinforcement history to underlying physically or health issues (eg. Pain caused by ill fitting tack, ulcers, soreness, kissing spines etc)

When dealing with a behavioral issue like this it‚Äôs important to break it down into digestible learning steps since the basic idea of ‚Äúwhen my leg is on you please trot off‚Äù isn‚Äôt established as such,.. we have to first explain the cue and its meaning and then we can built the duration from there. 

While a lot of people try to instantly go for ‚ÄúYou pick up a trot NOW and once you‚Äôre trotting I won‚Äôt let you get back to a walk Until I say so! And if you slow down you‚Äôll trot 10 more rounds‚Äù - pushing past the problem to directly get to the goal of wanting to trot for rounds at a time, the horse needs to clearly understand the different meanings of the leg itself or he‚Äôll easily start to mistake the driving aid more as a punisher and something he needs to be afraid off and ran away from rather than it being a trustworthy and reliable tool of communication.

By the time the horse is cow kicking, crow hopping or swinging his butt around he‚Äôs already reaching his own current limit of tolerance and understanding of what we‚Äôre asking him to do. Hence why punishment and getting ‚Äúpushier and more heavy handed‚Äù won‚Äôt help him understand better what he‚Äôs already not understanding in the first place. 

It‚Äôs like creating a yelling match of üê¥‚ÄúBut I don‚Äôt know what you what?!‚Äù - ü§¶üèº‍‚ôÄÔ∏è‚ÄùJust do the damn thing!‚Äù üê¥‚ÄùBut I don‚Äôt know what the damn thing is ?!‚Äù ‚Ä¶the more we stay in this fight the more it will escalate. The more frustration we built, the less progress is being made‚Ä¶

Instead. We break things down into the smallest reinforceable step that‚Äôs available to us like eg. walking a little faster.. from there we can work on please walk a little faster .. please pick up a split second the idea of a trot step‚Ä¶ please pick up one trot step..please pick up two trot steps and so on. üê¥üí´ 

@relentlesshntr
@_thehorsecenter 

#horsemanship #equestrian #horsesofinstagram #instahorse #horsetraining'}}]}

